		def self.get_webservice(uf,type,environment,service)
			WEB_SERVICES.filter{|service|
				cond = service[:uf] == uf and
							 service[:tipo] == type and
				       service[:ambiente] == environment and
				       service[:servico] == service
				cond
				}.first
		end
